import { React, useEffect } from "react";

const Final = ({ content, closeModal, children }) => {
  useEffect(() => {
    setTimeout(() => {
      closeModal();
    }, 3000);
  }, []);

  return (
    <div>
      <h2>Final</h2>
      <p>{content}</p>
      <p>Ana Maria</p>
      {children}
    </div>
  );
};

export default Final;
